import {React , useState} from 'react';

function T(){
  
    
    return(
        <section >
            <div>
              <input type="text" placeholder='name' value = {stud.name} onChange={(e)=> setstud({ ...stud , name : e.target.value})} />
              <input type="number" placeholder='number' value = {stud.age} onChange={(e)=> setstud( {...stud , age :e.target.value})} />
              <input type="text" placeholder='name' value = {stud.collage} onChange={(e)=> setstud( {...stud , collage : e.target.value})} />
              <input type="text" placeholder='name' value = {stud.status} onChange={(e)=> setstud( {...stud , status : e.target.value})} />
           </div>
           <h2>student name : {stud.name}</h2>
           <h2>age : {stud.age}</h2>
           <h2> collage : {stud.collage}</h2>
           <h2> status : {stud.status}</h2>
        </section>
        
    )
}
export default T ;
